// Función para guardar atributos de aeropuerto en una entidad específica
function guardarAtributoICAO() {
    console.log('Iniciando guardado de atributos de aeropuerto');
    
    // ID específico de la entidad donde guardar los atributos
 // Obtener la entidad objetivo desde stateParams
    const stateParams = widgetContext.stateController.getStateParams();
    console.log('State Params:', stateParams);
    
    // Buscar específicamente el parámetro miavion
    if (!stateParams || !stateParams.miavion || !stateParams.miavion.entityId) {
        console.error('No se encontró el parámetro miavion en stateParams');
        return;
    }
    
    const targetEntityId = stateParams.miavion.entityId;
    console.log('Entidad objetivo encontrada:', targetEntityId);
    
    console.log('Entidad objetivo encontrada:', targetEntityId);
    
    // Obtener datos de la entidad seleccionada
    let rowData = additionalParams && additionalParams.entity ? additionalParams.entity : null;
    
    if (!rowData) {
        console.error('No se encontraron datos de la entidad');
        return;
    }
    
    // Verificar atributos requeridos
    if (!rowData.ICAO) {
        console.error('No se encontró código ICAO en los datos');
        return;
    }
    
    if (!rowData.IATA) {
        console.error('No se encontró código IATA en los datos');
        return;
    }
    
    if (!rowData['NOMBRE AEROPUERTO']) {
        console.error('No se encontró nombre de aeropuerto en los datos');
        return;
    }
    
    console.log('Datos de aeropuerto a guardar:', rowData);
    console.log('Entidad objetivo:', targetEntityId);
    
    // Lista de todos los atributos que queremos guardar
    const attributeKeys = [
        'ICAO', 'IATA', 'NOMBRE AEROPUERTO', 'ELEVACION',
        'RWY1', 'RWY2', 'RWY 3', 'RWY4',
        'PCN1', 'PCN2', 'PCN3', 'PCN4',
        'SLOPE1', 'SLOPE2', 'SLOPE3', 'SLOPE4',
        'TODA1', 'TODA2', 'TODA3', 'TODA4',
        'TORA1', 'TORA2', 'TORA3', 'TORA4',
        'LDA1', 'LDA2', 'LDA3', 'LDA4'
    ];
    
    // Crear array de atributos con el formato correcto
    const attributesArray = [];
    
    // Añadir atributos existentes
    attributeKeys.forEach(key => {
        // Si el atributo existe en rowData, usarlo
        if (rowData[key] !== undefined) {
            attributesArray.push({ key: key, value: rowData[key] });
        } 
        // Si no existe y es un atributo de pista, usar "-"
        else if (key.startsWith('RWY') || key.startsWith('PCN') || 
                key.startsWith('SLOPE') || key.startsWith('TODA') || 
                key.startsWith('TORA') || key.startsWith('LDA')) {
            attributesArray.push({ key: key, value: "-" });
        }
        // Para ELEVACION, usar "0" si no existe
        else if (key === 'ELEVACION' && rowData[key] === undefined) {
            attributesArray.push({ key: key, value: "0" });
        }
    });
    
    try {
        // Obtener el servicio de atributos
        const attributeService = widgetContext.$scope.$injector.get(widgetContext.servicesMap.get('attributeService'));
        
        // Guardar los atributos en la entidad específica como atributos compartidos
        attributeService.saveEntityAttributes(
            targetEntityId,
            'SHARED_SCOPE', // Usar SHARED_SCOPE para atributos compartidos
            attributesArray
        ).subscribe(
            function success() {
                console.log('Atributos de aeropuerto guardados correctamente en la entidad específica');
                
                // Actualizar los alias del widget
                setTimeout(function() {
                    widgetContext.updateAliases();
                }, 1000);
                
                // Navegar al estado de panel "dispatch_conditions"
                openDashboardState("dispatch_conditions");
            },
            function error(err) {
                console.error('Error al guardar atributos de aeropuerto:', err);
            }
        );
    } catch (e) {
        console.error('Error:', e);
    }
}

// Función para navegar a un estado de panel específico
// Función para navegar a un estado de panel específico manteniendo solo la información de miavion
function openDashboardState(stateId) {
    // Obtener los parámetros actuales
    const stateParams = widgetContext.stateController.getStateParams();
    
    // Crear un nuevo objeto de parámetros con solo la información de miavion
    const params = {
        miavion: stateParams && stateParams.miavion ? stateParams.miavion : null
    };
    
    // Navegar al nuevo estado con los parámetros específicos
    widgetContext.stateController.openState(stateId, params, false);
}

