tooltipAction.customFunction:
function guardarAtributoICAO() {
    console.log('Iniciando guardado de atributos de aeropuerto');
    
    // Obtener la entidad objetivo desde stateParams.miavion
    const stateParams = widgetContext.stateController.getStateParams();
    console.log('State Params:', stateParams);
    
    let targetEntityId = null;
    
    // Buscar la entidad objetivo en stateParams.miavion
    if (stateParams && stateParams.miavion && stateParams.miavion.entityId) {
        targetEntityId = stateParams.miavion.entityId;
        console.log('Entidad objetivo encontrada en stateParams.miavion:', targetEntityId);
    } else {
        console.error('No se encontró el parámetro miavion en stateParams');
        return;
    }
    
    // Definir todos los atributos que queremos guardar
    const attributesToSave = {
        ICAO: null,
        IATA: null,
        RWY1: null,
        RWY2: null,
        'RWY 3': null,
        RWY4: null,
        PCN1: null,
        PCN2: null,
        PCN3: null,
        PCN4: null,
        SLOPE1: null,
        SLOPE2: null,
        SLOPE3: null,
        SLOPE4: null,
        TODA1: null,
        TODA2: null,
        TODA3: null,
        TODA4: null,
        TORA1: null,
        TORA2: null,
        TORA3: null,
        TORA4: null,
        LDA1: null,
        LDA2: null,
        LDA3: null,
        LDA4: null,
        'NOMBRE AEROPUERTO': null,
        ELEVACION: null,
        maxPerformance: "YES"
    };
    
    // Atributos requeridos que deben existir
    const requiredAttributes = ['ICAO', 'IATA', 'NOMBRE AEROPUERTO'];
    
    let entityData = null;

    // Función para extraer atributos de un objeto de datos
    function extractAttributes(data) {
        if (!data) return;
        
        // Iterar sobre todas las claves que queremos guardar
        Object.keys(attributesToSave).forEach(key => {
            // Actualizar el valor si existe en los datos
            if (data[key] !== undefined) {
                attributesToSave[key] = data[key];
            } else if (data.latest && data.latest[key]) {
                attributesToSave[key] = data.latest[key].value;
            }
        });
    }

    if (additionalParams) {
        console.log('additionalParams disponibles:', additionalParams);
        
        if (additionalParams.entityId && additionalParams.entityName) {
            console.log('Datos de entidad encontrados en additionalParams');
            entityData = {
                entityId: additionalParams.entityId,
                entityName: additionalParams.entityName
            };

            if (additionalParams.entityData || additionalParams.data) {
                const data = additionalParams.entityData || additionalParams.data;
                console.log('Datos adicionales encontrados:', data);
                extractAttributes(data);
            }
        }

        if (additionalParams.nodeCtx) {
            console.log('nodeCtx encontrado:', additionalParams.nodeCtx);
            if (additionalParams.nodeCtx.entity) {
                entityData = additionalParams.nodeCtx.entity;
            }
            if (additionalParams.nodeCtx.data) {
                extractAttributes(additionalParams.nodeCtx.data);
            }
        }
        
        // Si additionalParams tiene entity, extraer atributos de allí también
        if (additionalParams.entity) {
            console.log('Entidad encontrada en additionalParams:', additionalParams.entity);
            extractAttributes(additionalParams.entity);
        }
    }

    if (entityId && !hasRequiredAttributes()) {
        console.log('Intentando obtener datos del contexto global');
        
        if (widgetContext.data) {
            console.log('Datos del widget disponibles:', widgetContext.data);
            
            for (let i = 0; i < widgetContext.data.length; i++) {
                const dsData = widgetContext.data[i];
                if (dsData.data && dsData.data.length > 0) {
                    for (let j = 0; j < dsData.data.length; j++) {
                        const dataPoint = dsData.data[j];
                        extractAttributes(dataPoint);
                    }
                }
                if (hasRequiredAttributes()) break;
            }
        }
    }

    // Verificar si tenemos los atributos requeridos
    function hasRequiredAttributes() {
        return requiredAttributes.every(attr => attributesToSave[attr] !== null);
    }

    if (!hasRequiredAttributes()) {
        console.log('Intentando obtener atributos de la entidad seleccionada');
        
        const attributeService = widgetContext.$scope.$injector.get(widgetContext.servicesMap.get('attributeService'));
        
        if (entityId) {
            attributeService.getEntityAttributes(entityId, 'SERVER_SCOPE').subscribe(
                function(attributes) {
                    console.log('Atributos obtenidos:', attributes);
                    
                    // Procesar cada atributo obtenido
                    attributes.forEach(attr => {
                        if (attr.key in attributesToSave) {
                            attributesToSave[attr.key] = attr.value;
                        }
                    });

                    if (hasRequiredAttributes()) {
                        procederConGuardado();
                    } else {
                        console.error('No se encontraron atributos requeridos en la entidad');
                        console.error('Atributos requeridos faltantes:', 
                            requiredAttributes.filter(attr => attributesToSave[attr] === null));
                    }
                },
                function(error) {
                    console.error('Error al obtener atributos:', error);
                }
            );
            return;
        }
    } else {
        procederConGuardado();
    }

    function procederConGuardado() {
        if (!hasRequiredAttributes()) {
            console.error('No se pudo obtener los atributos requeridos para guardar');
            return;
        }

        // Establecer valores predeterminados para atributos de pista que no existen
        Object.keys(attributesToSave).forEach(key => {
            // Si es un atributo de pista y no tiene valor, establecerlo como "-"
            if ((key.startsWith('RWY') || key.startsWith('PCN') || 
                 key.startsWith('SLOPE') || key.startsWith('TODA') || 
                 key.startsWith('TORA') || key.startsWith('LDA')) && 
                attributesToSave[key] === null) {
                attributesToSave[key] = "-";
            }
            
            // Para otros atributos no requeridos, establecer un valor predeterminado si es null
            if (!requiredAttributes.includes(key) && 
                !key.startsWith('RWY') && !key.startsWith('PCN') && 
                !key.startsWith('SLOPE') && !key.startsWith('TODA') && 
                !key.startsWith('TORA') && !key.startsWith('LDA') && 
                attributesToSave[key] === null) {
                
                if (key === 'ELEVACION') {
                    attributesToSave[key] = "0";
                } else {
                    attributesToSave[key] = "-";
                }
            }
        });

        console.log('Valores a guardar:', attributesToSave);
        console.log('Entidad objetivo:', targetEntityId);

        const attributesArray = [];
        
        // Convertir el objeto de atributos a un array de {key, value}
        Object.keys(attributesToSave).forEach(key => {
            attributesArray.push({ key: key, value: attributesToSave[key] });
        });

        try {
            const attributeService = widgetContext.$scope.$injector.get(widgetContext.servicesMap.get('attributeService'));
            
            attributeService.saveEntityAttributes(
                targetEntityId,
                'SHARED_SCOPE',
                attributesArray
            ).subscribe(
                function success() {
                    console.log('Atributos guardados correctamente en la entidad seleccionada (miavion)');

                    setTimeout(function() {
                        widgetContext.updateAliases();
                    }, 1000);
                    
                    openDashboardState("dispatch_conditions");
                },
                function error(err) {
                    console.error('Error al guardar atributos:', err);
                }
            );
        } catch (e) {
            console.error('Error:', e);
        }
    }
}

function openDashboardState(stateId) {
    // Obtener los parámetros actuales
    const stateParams = widgetContext.stateController.getStateParams();
    
    // Crear un nuevo objeto de parámetros con solo la información de miavion
    const params = {
        miavion: stateParams && stateParams.miavion ? stateParams.miavion : null
    };
    
    // Navegar al nuevo estado con los parámetros específicos
    widgetContext.stateController.openState(stateId, params, false);
}

