let confirmDelete = confirm('¿Shure you want to Clear the Table?');
if (!confirmDelete) return;

console.log('widgetContext:', widgetContext);

let timeseries = [];

// Recorrer cada fuente de datos del widget
widgetContext.data.forEach(ds => {
    // Solo incluir las series de datos que tienen al menos un valor en el rango de tiempo
    if (ds.data && ds.data.length > 0) {
        timeseries.push({ key: ds.dataKey.name });
    }
});

if (timeseries.length === 0) {
    console.warn('No se encontraron series de datos con telemetría para eliminar.');
    return;
}

let startTs = Math.floor(widgetContext.timeWindow.minTime);
let endTs = Math.floor(widgetContext.timeWindow.maxTime);

console.log('Eliminando telemetría para:', {
    entidad: entityId,
    series: timeseries,
    desde: new Date(startTs).toISOString(),
    hasta: new Date(endTs).toISOString()
});

// `false` indica que no es una eliminación "en profundidad" (por claves exactas y timestamps)
widgetContext.attributeService.deleteEntityTimeseries(entityId, timeseries, false, startTs, endTs)
    .subscribe(
        res => {
            console.log('Telemetría eliminada exitosamente:', res);
            // Opcional: refrescar el widget después de eliminar
            if (widgetContext.reload) {
                setTimeout(() => widgetContext.reload(), 1000);
            }
        },
        err => {
            console.error('Error al eliminar la telemetría:', err);
        }
    );

