settings.rowStyleFunction:
// Mapeo de columnas F a atributos RWY
var columnToAttributeMap = {
  'F1': 'RWY1',
  'F2': 'RWY2',
  'F3': 'RWY3',
  'F4': 'RWY4'
};

// Si es una columna F que queremos reemplazar
if (columnToAttributeMap[value]) {
  var attributeName = columnToAttributeMap[value];
  
  // Intentar obtener el valor del atributo correspondiente
  if (ctx.datasource && ctx.datasource.latestData) {
    // Buscar en latestData el atributo correspondiente
    for (var i = 0; i < ctx.datasource.latestData.length; i++) {
      var dataKey = ctx.datasource.latestData[i];
      if (dataKey.dataKey.name === attributeName) {
        // Si encontramos el atributo, usamos su valor como nombre de columna
        return dataKey.data[0][1] || value;
      }
    }
  }
  
  // Si no encontramos el atributo en latestData, intentamos con latestDataKeys
  if (ctx.datasource && ctx.datasource.latestDataKeys) {
    for (var i = 0; i < ctx.datasource.latestDataKeys.length; i++) {
      var dataKey = ctx.datasource.latestDataKeys[i];
      if (dataKey.name === attributeName) {
        // Si el valor está disponible, lo usamos
        if (dataKey.value !== undefined) {
          return dataKey.value;
        }
      }
    }
  }
  
  // Si no encontramos el valor, podemos intentar con entityId y attributeName
  if (ctx.datasource && ctx.datasource.entityId) {
    // Aquí podríamos hacer una llamada a la API para obtener el atributo,
    // pero esto requeriría una función asíncrona que no es compatible con este contexto
    
    // Como alternativa, podemos mostrar un formato que indique que estamos usando el atributo
    return "Pista " + attributeName.replace("RWY", "");
  }
}

// Para otras columnas, podemos usar un mapeo estático como antes
var columnNames = {
  'climbLimitedWeight': 'Límite Ascenso',
  'tireLimitedWeight': 'Límite Neumáticos',
  'brakeLimitedWeight': 'Límite Frenos',
  'limitante': 'Factor Limitante',
  'speedV1': 'Velocidad V1',
  'speedVr': 'Velocidad VR',
  'speedV2': 'Velocidad V2',
  'Temperaturas': 'Temperatura (°C)'
};

return columnNames[value] || value;
}

headerButton.customFunction:
let confirmDelete = confirm('¿Seguro que desea eliminar la Telemetría?');
if (!confirmDelete) return;

console.log('widgetContext:', widgetContext);

let timeseries = [];

// Recorrer cada fuente de datos del widget
widgetContext.data.forEach(ds => {
    // Solo incluir las series de datos que tienen al menos un valor en el rango de tiempo
    if (ds.data && ds.data.length > 0) {
        timeseries.push({ key: ds.dataKey.name });
    }
});

if (timeseries.length === 0) {
    console.warn('No se encontraron series de datos con telemetría para eliminar.');
    return;
}

let startTs = Math.floor(widgetContext.timeWindow.minTime);
let endTs = Math.floor(widgetContext.timeWindow.maxTime);

console.log('Eliminando telemetría para:', {
    entidad: entityId,
    series: timeseries,
    desde: new Date(startTs).toISOString(),
    hasta: new Date(endTs).toISOString()
});

// `false` indica que no es una eliminación "en profundidad" (por claves exactas y timestamps)
widgetContext.attributeService.deleteEntityTimeseries(entityId, timeseries, false, startTs, endTs)
    .subscribe(
        res => {
            console.log('Telemetría eliminada exitosamente:', res);
            // Opcional: refrescar el widget después de eliminar
            if (widgetContext.reload) {
                setTimeout(() => widgetContext.reload(), 1000);
            }
        },
        err => {
            console.error('Error al eliminar la telemetría:', err);
        }
    );

