settings.cardCss:
/* Base styles - ultra compact */
* {
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}

body {
  font-family: Arial, sans-serif;
  line-height: 1.2;
  padding: 10px;
  max-width: 1200px;
  margin: 0 auto;
  font-size: 14px;
}

/* Compact header section */
.header {
  margin-bottom: 8px;
}

.header-title {
  text-align: center;
  margin-bottom: 5px;
}

.header-title h2 {
  font-size: 1.3rem;
  margin: 0;
  line-height: 1.1;
}

.header-row {
  display: flex;
  justify-content: space-between;
  align-items: flex-start;
  flex-wrap: wrap;
}

.aircraft-config {
  flex: 1;
  min-width: 200px;
}

.aircraft-config h3 {
  font-size: 1rem;
  margin: 0;
  line-height: 1.1;
}

.airport-info {
  text-align: right;
  flex: 1;
  min-width: 200px;
  line-height: 1.1;
}

.airport-info p {
  margin: 0;
}

/* Ultra-compact configuration section */
.config-grid {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 5px;
  border: 1px solid #000;
  padding: 5px;
  margin-bottom: 8px;
}

.config-column {
  padding: 3px;
}

.config-column h4 {
  margin: 0 0 3px 0;
  font-weight: bold;
  text-align: center;
  border-bottom: 1px solid #ccc;
  padding-bottom: 2px;
  font-size: 0.9rem;
}

.config-item {
  display: flex;
  justify-content: space-between;
  margin-bottom: 0;
  line-height: 1.1;
}

.config-label {
  font-weight: normal;
  font-size: 0.9rem;
}

.config-value {
  text-align: right;
  font-size: 0.9rem;
}

/* Altitude pressure section */
.altitude-pressure {
  text-align: center;
  margin-bottom: 8px;
  padding: 3px;
  background-color: #f8f8f8;
  border-radius: 3px;
  font-size: 0.9rem;
}

/* Limitation codes section */
.limitation-codes {
  font-size: 0.85rem;
  margin-bottom: 8px;
  line-height: 1.1;
}

/* Runway data table */
.runway-table {
  width: 100%;
  border-collapse: collapse;
  margin-bottom: 8px;
  font-size: 0.85rem;
}

.runway-table th {
  background-color: #e0e0e0;
  font-weight: bold;
  text-align: center;
  padding: 2px;
  border: 1px solid #000;
}

.runway-table td {
  padding: 1px 2px;
  border: 1px solid #000;
  text-align: center;
}

.runway-table td:first-child {
  text-align: left;
  font-weight: 500;
}

/* Weight check notice */
.weight-check {
  background-color: #ffcccc;
  padding: 3px;
  text-align: center;
  margin-bottom: 8px;
  border: 1px solid #000;
  font-size: 0.9rem;
  font-weight: bold;
}

/* Footer */
.footer {
  text-align: center;
  font-size: 0.8rem;
  color: #666;
  margin-top: 5px;
}

/* Responsive adjustments */
@media (max-width: 768px) {
  .config-grid {
    grid-template-columns: 1fr;
  }
  
  .config-column {
    border-bottom: 1px solid #ccc;
    padding-bottom: 5px;
    margin-bottom: 5px;
  }
  
  .config-column:last-child {
    border-bottom: none;
    margin-bottom: 0;
  }
  
  .runway-table {
    font-size: 0.75rem;
  }
  
  .runway-table th, .runway-table td {
    padding: 1px;
  }
}

@media (max-width: 480px) {
  .header-row {
    flex-direction: column;
  }
  
  .aircraft-config, .airport-info {
    width: 100%;
    text-align: center;
    margin-bottom: 5px;
  }
  
  .config-item {
    flex-direction: row;
    margin-bottom: 0;
  }
  
  /* Make runway table scroll horizontally on small screens */
  .runway-table-container {
    overflow-x: auto;
  }
  
  .runway-table {
    min-width: 450px;
  }
}

